///////////////

var canvas = null;
var sheet = null;
var ctx = null;
var imageCount=15;
var ballRadius = 6;
var x = null;
var y = null
var dx = 3;
var dy = -3;
var dspeed = Math.sqrt(dx*dx+dy*dy);
var paddleHeight = 10;
var paddleWidth = 75;
var paddleX = null;
var rightPressed = false;
var leftPressed = false;
var brickRowCount = 6;
var brickColumnCount = 3;
var brickWidth = 61;
var brickHeight = 61;
var brickPadding = 10;
var brickOffsetTop = 30;
var brickOffsetLeft = 30;
var score = 0;
var lives = 3;
var bricks = [];
for (var c = 0; c < brickColumnCount; c++) {
    bricks[c] = [];
    for (var r = 0; r < brickRowCount; r++) {
        bricks[c][r] = { x: 0, y: 0, status: 1 };
    }
}

function keyDownHandler(e) {
    if (e.keyCode == 39) {
        rightPressed = true;
    } else if (e.keyCode == 37) {
        leftPressed = true;
    }
}
function keyUpHandler(e) {
    if (e.keyCode == 39) {
        rightPressed = false;
    } else if (e.keyCode == 37) {
        leftPressed = false;
    }
}
function mouseMoveHandler(e) {
    var relativeX = e.clientX - canvas.offsetLeft;
    if (relativeX > 0 && relativeX < canvas.width) {
        paddleX = relativeX - paddleWidth / 2;
    }
}
//Do a check before updating position. Return if collision happened.
function collision(x,y,b)
{
    if (x > b.x &&
        x < b.x + brickWidth &&
        y > b.y &&
        y < b.y + brickHeight)
    {
        return true;
    }
    return false;
}
function betterCollisionDet()
{
    let normdX = dx/Math.ceil(dspeed*10);
    let normdY = dy/Math.ceil(dspeed*10);
    for (var c = 0; c < brickColumnCount; c++) {
        for (var r = 0; r < brickRowCount; r++) {
            var b = bricks[c][r];
            if (b.status == 1) {
                let newX = x+dx;
                let newY = y+dy;
                //Coarse collision check
                if (collision(newX,newY,b))
                {
                    let cdetected = false;
                    //Granular collision check;
                    for(let step = 1; step<=Math.ceil(dspeed*10); step++)
                    {

                        if(collision(x+normdX,y,b)){
                            dx=-dx;
                            cdetected=true;
                        }
                        //y+=normdY;
                        else if(collision(x,y+normdY,b)){
                            dy=-dy;
                            cdetected=true;
                        }
                        x+=normdX;
                        y+=normdY;
                        if(cdetected==true)
                        {
                            x+=Math.sign(dx)*(Math.abs(dx)-Math.abs(normdX)*step);
                            y+=Math.sign(dy)*(Math.abs(dy)-Math.abs(normdY)*step);
                            break;
                        }
                    }
                    if(cdetected==false){
                        dy=-dy;
                        dx=-dx;
                    }
                    b.status = 0;
                    score++;
                    if (score == brickRowCount * brickColumnCount) {
                        alert("POBJEDILI STE, ČESTITAMO!");
                       // document.location.reload();
                        util.dismissDialog("gameDialog");
                    }
                    return true;
                }
            }
        }
    }
}
function drawBall() {
    ctx.beginPath();
    ctx.arc(x, y, ballRadius, 0, Math.PI * 2);
    ctx.fillStyle = "black";
    ctx.fill();
    ctx.closePath();
}
function drawPaddle() {
    ctx.beginPath();
    ctx.rect(paddleX, canvas.height - paddleHeight, paddleWidth, paddleHeight);
    ctx.fillStyle = "#0095DD";
    ctx.fill();
    ctx.closePath();
}
function drawBricks() {
    let srcX = 0;
    let srcY = 0
    for (var c = 0; c < brickColumnCount; c++) {
        for (var r = 0; r < brickRowCount; r++) {
            if((r+1)*(c+1)<imageCount){
                srcX = r*100;
                srcY = c*100;
            }
            if (bricks[c][r].status == 1) {
                var brickX = r * (brickWidth + brickPadding) + brickOffsetLeft;
                var brickY = c * (brickHeight + brickPadding) + brickOffsetTop;
                //debugger;
                bricks[c][r].x = brickX;
                bricks[c][r].y = brickY;

                ctx.drawImage(sheet,srcX,srcY,100,100, brickX, brickY, brickWidth, brickHeight);
            }
        }
    }
}
function drawScore() {
    ctx.font = "16px Comic Sans MS";
    ctx.fillStyle = "#0095DD";
    ctx.fillText("Bodovi: " + score, 8, 20);
}
function drawLives() {
    ctx.font = "16px  Comic Sans MS";
    ctx.fillStyle = "#0095DD";
    ctx.fillText("Životi: " + lives, canvas.width - 65, 20);
}
function draw() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    drawBricks();
    drawBall();
    drawPaddle();
    drawScore();
    drawLives();
    //collisionDetection();
    let collided = betterCollisionDet();
    //Canvas side collision
    if (x + dx > canvas.width - ballRadius || x + dx < ballRadius) {
        dx = -dx;
    }
    //Canvas top collision
    if (y + dy < ballRadius) {
        dy = -dy;
    }
    //Canvas bottom collision
    else if (y + dy > canvas.height - ballRadius) {
        //Paddle collision override
        if (x > paddleX && x < paddleX + paddleWidth) {
            //Let's makesome better physics by adding angle variance
            //Normalize to [-1,1]
            let halfW = paddleWidth/2;
            let norm = (x-paddleX-halfW)/(halfW);
            let normAbs = Math.abs(norm);
            let normSign = Math.sign(norm);
            let newAngle = (Math.PI/6)+(4*Math.PI/12)*(1-normAbs);
            dy = -dspeed*Math.sin(newAngle);
            dx = dspeed*Math.cos(newAngle)*normSign;
        }
        //Death
        else {
            lives--;
            if (!lives) {
                alert("KRAJ IGRE");
                util.dismissDialog("gameDialog");
            } else {
                x = canvas.width / 2;
                y = canvas.height - 30;
                dx = 3;
                dy = -3;
                paddleX = (canvas.width - paddleWidth) / 2;
            }
        }
    }
    if (rightPressed && paddleX < canvas.width - paddleWidth) {
        paddleX += 7;
    } else if (leftPressed && paddleX > 0) {
        paddleX -= 7;
    }
    //Update position
    if(!collided){
        x += dx;
        y += dy;
    }
    requestAnimationFrame(draw);
}
